results.releaseNotes:
• Content management improvements to speed up new content downloads;
• Fixed several crashes reported by the users.

If you experience any issues with the app, please let us know at support@jumsoft.com. If you like the app, we would appreciate your rating and review on the App Store for fellow users.

- Улучшена работа Push-уведомлений. Теперь все сообщения будут появляться в приложении непосредственно до его запуска.
- Проведена оптимизация синхронизации данных с сервером.
- Расширен функционал по работе с сообщениями, добавлена функция "Multiselect".
- Изменена максимальная длина текстового и зашифрованного сообщений.

Устранены следующие проблемы:
  - Некорректная работа функции "Поиск" среди участников в групповых чатах;
  - Некорректная работа функции "IsTyping...";
  - Изменена логика функции установки пароля в приложении, исправлены небольшие ошибки;
  - Низкое качество передаваемых изображений.

Исправление других небольших ошибок, повышение стабильности работы приложения.
